import React from 'react';
import { Sidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';

export default function SideBar() {
    return (
        <div>
            <Sidebar>
            <Menu>
                <MenuItem>Home</MenuItem>
            </Menu>
        </Sidebar>
        </div>
        
    );
}
